column8:
弊社は楽天市場店の他に店頭や雑誌広告でも通信販売を行っており、<br>
タイミングによっては商品が欠品になっている可能性もあります。<br>
購入手続きが完了してもすでに完売となっている場合、納期が掛かる事をご了承ください。<br>
実際の在庫状況等については受注確認メールでご案内いたします。JB23の4型以降のグリルとボンネットが<br>
別体式になってからのジムニーに装着可能な<br>
ブラックビニールレザー製のノーズブラです。<br>
若干たるみが出ますが、写真のようにハスラーにも装着可能です。<br>
ボンネット先端に被せて、<br>
裏側4箇所の長さ調整式フックで固定し、<br>
余り部分をエンジンに接触しないように束ねていただき、<br>
ボンネットキャッチ部を<br>
マジックテープで固定するだけですので、<br>
洗車時等の脱着も簡単です。<br>
北米では昔からポピュラーなカスタマイズが<br>
日本のジムニー用に上陸しました。<br>
虫よけ効果と、飛び石から<br>
ボンネット先端部分をガードします。<br>
マイナーチェンジ後の9型にも写真のように装着可能で,
<br>
オデコが広がった新型にも良く似合います。<br>
ボンネットとグリルが別体になった<br>
現行1300ccのJB43にも装着可能です。<br><br>送料区分 ： 120<!-- ここから リア受 -->
